import Cardlist from './Cardlist';
import {robots} from './robots';
import SearchBox from './SearchBox';

const state ={
	robots: robots,
	searchfield: ''
}
class App extends Component {
	constructor(){
		super()
		this.state ={
			robots: robots,
			searchfield: ''
		} 
	}
	render(){
		return(
		<div className='tc'>
		<h1>RoboFriends</h1>
		<SearchBox />
	 	<Cardlist robots={robots} /> 
	 	</div>
	 );

	}
	
}

export default App;
